css.value:
.uip-main-menu{
    min-width:230px;
}
html[uip-menu-collapsed="true"] .uip-main-menu{
    min-width:1px 
}

html[uip-menu-collapsed="true"] .uip-main-menu .uip-icon-medium{
    margin-right:0 !important;
}

html[uip-menu-collapsed='true'] .uip-admin-submenu{
    margin-left: 0 !important;
}

html[uip-menu-collapsed='true'] .uip-dash-logo{
    width:25px !important;
    height: 25px !important;
}
html[uip-menu-collapsed='true'] .uip-dark-mode-toggle{
    display: none !important;
}

.uip-sub-level-item::before{
    content:'';
    width:6px;
    height:6px;
    background-color:var(--uip-color-base-2);
    display:block;
    position:absolute;
    left:17px;
    border-radius:50%;
    margin-top:6px;
}
.uip-sub-level-item-active.uip-sub-level-item::before{
    background-color:var(--uip-color-accent-darker);
}
html[uip-menu-collapsed='true'] .uip-admin-submenu{
    margin-top:0px !important;
    margin-bottom:0px !important;
    border: none !important;
    padding: 15px !important;
}
html[uip-menu-collapsed='true'] .uip-sub-menu-header{
    background:none !important;
}

html[uip-menu-collapsed='true'] .uip-sub-level-item::before{
    display:none;
}

html[uip-menu-collapsed='true'] .uip-admin-menu > .uip-flex.uip-flex-column{
    align-items: center;
}

